portalLogoName:"Logotipo y nombre",changeThumb:"Haz clic para cambiar la vista en miniatura",siteNoticeSetting:"Aviso de acceso",setSiteNotice:"Establecer aviso de acceso",editSiteNotice:"Editar aviso de acceso",updateSiteNotice:"Actualizar aviso de acceso",siteNoticeDesc:"Proporcione un aviso de t\u00e9rminos que se mostrar\u00e1 a todos los usuarios que accedan a su organizaci\u00f3n. Los usuarios podr\u00e1n continuar solo si aceptan los t\u00e9rminos del aviso. No se volver\u00e1 a preguntar mientras dure su sesi\u00f3n de navegador.",
classificationBannerSetting:"Banner de informaci\u00f3n",setClassificationBanner:"Definir banner de informaci\u00f3n",infoBannerSettingsDesc:"Utilice los banners de informaci\u00f3n para avisar a todos los usuarios que acceden a la organizaci\u00f3n acerca del estado y contenido del sitio, por ejemplo, programas de mantenimiento, alertas de informaci\u00f3n clasificada y modos de solo lectura. Los banners aparecer\u00e1n en las partes superior e inferior de sus p\u00e1ginas.",editClassificationBanner:"Editar banner de informaci\u00f3n",
classificationBannerDesc:"Utilice los banners de informaci\u00f3n para avisar a su organizaci\u00f3n de acontecimientos breves, pero que persisten en relaci\u00f3n al estado de su sitio y su contenido, por ejemplo, programas de mantenimiento, alertas de informaci\u00f3n clasificada y modos de solo lectura. Los banners aparecer\u00e1n en las partes superior e inferior de sus p\u00e1ginas.",orgName:"Nombre de la organizaci\u00f3n",portalName:"Nombre",verifySetting:"Verificaci\u00f3n de la organizaci\u00f3n",
verifyDesc:"Para marcar como Acreditado los elementos que ha compartido con todo el mundo, debe solicitar que Esri verifique la identidad de su organizaci\u00f3n. Para ello, aseg\u00farese de que su organizaci\u00f3n permita el acceso an\u00f3nimo (Configuraci\u00f3n \x3e Seguridad \x3e Pol\u00edticas) y luego haga clic en el bot\u00f3n Verificar que aparece abajo. Aparecer\u00e1 el borrador de un mensaje de correo electr\u00f3nico. Env\u00edelo al Servicio de atenci\u00f3n al cliente de Esri. No modifique el texto ni los destinatarios de este mensaje. Una vez recibido, el Servicio de atenci\u00f3n al cliente comprobar\u00e1 que el nombre de su organizaci\u00f3n coincida con su nombre de cliente en un plazo de 24 - 48 horas h\u00e1biles; el bot\u00f3n Verificar ser\u00e1 sustituido por el distintivo Verificada.\x3cbr\x3e\x3cbr\x3e\x3cstrong\x3eNota:\x3c/strong\x3e Una vez hayamos verificado su organizaci\u00f3n, no es posible modificar el nombre de la organizaci\u00f3n ni su estado, y todos los elementos acreditados compartidos con todo el mundo se atribuir\u00e1n al nombre de la organizaci\u00f3n.",
verifyAction:"Verificar",verifiedBadge:"Verificada",verifyTooltip:"M\u00e1s informaci\u00f3n sobre la verificaci\u00f3n de la organizaci\u00f3n.",mustAllowAnonymousAccess:"Su organizaci\u00f3n debe permitir el acceso an\u00f3nimo para poder solicitar la verificaci\u00f3n. Modifique este ajuste en la secci\u00f3n Pol\u00edticas de la pesta\u00f1a Seguridad.",contactSetting:"Contacto de la organizaci\u00f3n",contactDesc:"La informaci\u00f3n de contacto especificada se muestra en la pesta\u00f1a Proveedor de las listas de su organizaci\u00f3n en ArcGIS Marketplace.",
