sslDescPortal:"Permitir el acceso al portal solo a trav\u00e9s de ${startSpan}HTTPS${endSpan}.",sslTooltip:"La activaci\u00f3n de HTTPS incrementa el nivel de protecci\u00f3n de su organizaci\u00f3n. HTTPS garantiza que sus datos y la informaci\u00f3n acerca de usted est\u00e9n cifrados durante la comunicaci\u00f3n a trav\u00e9s de Internet.",httpsPopupWarning:"Su organizaci\u00f3n permite el acceso a trav\u00e9s de HTTP. Esri recomienda configurar la organizaci\u00f3n de ArcGIS Online de modo que solo permita el acceso a ella a trav\u00e9s de HTTPS. HTTPS garantiza que los datos alojados y otras comunicaciones con ArcGIS Online est\u00e9n cifrados cuando se accede a ellos a trav\u00e9s de Internet.",
httpsWarning:"Su organizaci\u00f3n permite el acceso a trav\u00e9s de HTTP. Esri recomienda configurar la organizaci\u00f3n de ArcGIS Online de modo que solo permita el acceso a ella a trav\u00e9s de HTTPS. Si HTTPS est\u00e1 habilitado, se podr\u00e1 acceder a los datos alojados de su organizaci\u00f3n y a la identidad de los miembros de su organizaci\u00f3n solo a trav\u00e9s de HTTPS. HTTPS garantiza que los datos alojados y otras comunicaciones con ArcGIS Online est\u00e9n cifrados cuando se accede a ellos a trav\u00e9s de Internet.",
httpsWarningPortal:"Su organizaci\u00f3n permite el acceso a trav\u00e9s de HTTP. Esri recomienda configurar su organizaci\u00f3n de modo que solo permita el acceso a ella a trav\u00e9s de HTTPS. Si HTTPS est\u00e1 habilitado, se podr\u00e1 acceder a los datos alojados de su organizaci\u00f3n y a la identidad de los miembros de su organizaci\u00f3n solo a trav\u00e9s de HTTPS. HTTPS garantiza que los datos alojados y otras comunicaciones con su portal de Enterprise est\u00e9n cifrados.",policiesSetting:"Pol\u00edticas",
