disableMultiFactorUserMsg:"\u00bfEst\u00e1s seguro de que deseas deshabilitar la autenticaci\u00f3n multifactor para el miembro ${user}? Esto eliminar\u00e1 el nivel adicional de protecci\u00f3n que ese miembro tiene actualmente.",errorDisableMultiFactor:"Se ha detectado un problema al intentar deshabilitar la autenticaci\u00f3n multifactor para ${user}.",disableMultiFactorSuccess:"La autenticaci\u00f3n multifactor se ha deshabilitado correctamente para ${user}.",needTwoAdminDeleteMsg:"No se puede eliminar al miembro ${user}. Debes mantener al menos dos administradores para permitir la autenticaci\u00f3n multifactor en tu organizaci\u00f3n.",
